import { Component } from '@angular/core';
import { AuthService } from './auth.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {

  title: string;

  constructor(private authService: AuthService) {
    this.title = 'Spring Boot - Angular Application';
  }

  login() {
    // Appelez la méthode de login du service AuthService
    this.authService.login('username', 'password').subscribe(() => {
      // Effectuez les opérations nécessaires après une connexion réussie
    });
  }

  logout() {
    // Appelez la méthode de logout du service AuthService
    this.authService.logout().subscribe(() => {
      // Effectuez les opérations nécessaires après une déconnexion réussie
    });
  }
}
